import React, { useState } from 'react';
import './SignIn.css';
import background from '../../assets/bg.svg';
import avatar from '../../assets/avatar.svg';
import wave from '../../assets/wave.png';
import { ToastContainer, toast } from 'react-toastify'; 
import 'react-toastify/dist/ReactToastify.css'; 
import { useNavigate } from 'react-router-dom'; 
import axios from 'axios'; 
import Validation from '../Validation/LoginValidation'; // Import the validation function

const SignIn = () => {
    const [values, setValues] = useState({
        email: '',
        password: '',
    });

    const [errors, setErrors] = useState({});
    const navigate = useNavigate(); 

    const handleChange = (e) => {
        setValues({
            ...values,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        // Validate the form values
        const validationErrors = Validation(values);
        setErrors(validationErrors); // Set errors after validating the form

        // Proceed only if there are no validation errors
        if (Object.keys(validationErrors).length === 0) {
            try {
                const response = await axios.post('http://localhost:8087/signin', values);
                console.log('Response:', response.data); // Log the response

                if (response.data === "Success") {
                    toast.success('Login successful!');
                    navigate('/home'); 
                } else if (response.data === "Fail") {
                    setErrors({ general: 'Invalid email or password' });
                    toast.error('Invalid email or password'); // Toast for invalid credentials
                }
            } catch (error) {
                console.error('Error:', error.response ? error.response.data : error.message);
                setErrors({ general: 'An error occurred. Please try again later.' });
                toast.error('An error occurred. Please try again later.');
            }
        }
    };

    return (
        <div>
            <img className="wave" src={wave} alt="wave" />
            <div className="container">
                <div className="img">
                    <h1 className="title1">SIGN IN</h1>
                    <img src={background} alt="background" />
                </div>
                <div className="login-content">
                    <form onSubmit={handleSubmit}>
                        <img src={avatar} alt="avatar" />
                        <h2 className="title">Welcome Back</h2>

                        <div className="input-div one">
                            <div className="i">
                                <i className="fas fa-envelope"></i>
                            </div>
                            <div className="div">
                                <input 
                                    type="email" 
                                    className="input" 
                                    placeholder='Email'
                                    name="email"
                                    value={values.email}
                                    onChange={handleChange} 
                                />
                                {errors.email && <span className="error-message">{errors.email}</span>} {/* Display email error */}
                            </div>
                        </div>

                        <div className="input-div pass">
                            <div className="i">
                                <i className="fas fa-lock"></i>
                            </div>
                            <div className="div">
                                <input 
                                    type="password" 
                                    className="input" 
                                    placeholder='Password'
                                    name="password"
                                    value={values.password}
                                    onChange={handleChange} 
                                />
                                {errors.password && <span className="error-message">{errors.password}</span>} {/* Display password error */}
                            </div>
                        </div>

                        <input type="submit" className="btn" value="Sign In" />
                        <a href='/signup' className="abtn">SIGN UP</a>
                        <p>Don't Have An Account?</p>
                    </form>
                </div>
            </div>
            <ToastContainer /> {/* Add ToastContainer for notifications */}
        </div>
    );
};

export default SignIn;
